1058	1039	attr	description	try this:\r\nhttps://stackoverflow.com/questions/43424994/install-redmine-plug-in-using-docker-container\r\n\r\n\r\nsee "starter":https://github.com/bitnami/bitnami-docker-redmine/issues/115\r\n\r\nsee "detail":https://stackoverflow.com/questions/43424994/install-redmine-plug-in-using-docker-container\r\n\r\nUse Top to monitor progress\r\n<pre>\r\n#cleanup\r\ndocker system prune \r\nsource ./scripts/initialize.sh\r\n\r\n# basic build\r\ndocker-compose build\r\ndocker-compose up\r\n# works?\r\n{CTRL-C}\r\n\r\n#upgrade to new app with plugin libraries (but no plugins)\r\n#edit docker-compose to use new redmine build (option 2, comment out 1)\r\ndocker-compose build\r\ndocker-compose up\r\n# works?\r\n\r\n# import prod data\r\ndocker cp hub/data/redmine.sql brs_postgresql_1:/tmp\r\ndocker exec -it brs_postgresql_1 /bin/bash\r\npg_restore --clean --if-exists --no-acl --no-owner --verbose -d bitnami_redmine -U postgres /tmp/redmine.sql\r\npsql -U postgres -c 'ALTER USER bn_redmine WITH SUPERUSER;'\r\nexit\r\n\r\n# import prod data - migrate\r\ndocker exec -it brs_redmine_1 /bin/bash\r\ncd /opt/bitnami/redmine\r\nbundle exec rake db:migrate RAILS_ENV=production\r\ntouch tmp/restart.txt\r\n# works?\r\nexit\r\n\r\n# add new plugs libraries\r\ndocker cp hub/redmine_agile brs_redmine_1:/bitnami/redmine/plugins\r\ndocker cp hub/redmine_checklists brs_redmine_1:/bitnami/redmine/plugins\r\ndocker cp hub/redmineup_tags brs_redmine_1:/bitnami/redmine/plugins\r\n\r\n# add new plugs libraries - activate\r\n\r\ndocker exec -it brs_redmine_1 /bin/bash\r\ncd /opt/bitnami/redmine\r\nbundle exec rake redmine:plugins NAME=redmine_agile RAILS_ENV=production\r\nbundle exec rake redmine:plugins NAME=redmine_checklists RAILS_ENV=production\r\nbundle exec rake redmine:plugins NAME=redmineup_tags RAILS_ENV=production\r\ntouch ./tmp/restart.txt\r\n# works?\r\n\r\n#load wiki...\r\n\r\n# increase upload file size\r\n# https://www.cyberciti.biz/faq/linux-unix-bsd-nginx-413-request-entity-too-large/\r\n\r\ndocker run --rm -it -v=brs_nginx_data:/tmp/myvolume busybox\r\ncd /tmp/myvolume/conf.d\r\nvi custom_proxy_settings.conf\r\n# client_max_body_size 16m;\r\nexit\r\n\r\n#add logo\r\n#add users\r\n\r\n#needed?\r\ndocker cp wiki/ClipUpload brs_mediawiki_1:/extensions/ClipUpload\r\n\r\nimport pages\r\nimport images\r\nedit LocalSetting:  set logo, add custome\r\n\r\nsetup notebooks\r\n\r\n</pre>\r\n\r\n\r\n!clipboard-202006152221-duu2r.png!\r\n	this:\r\nhttps://www.redmine.org/boards/2/topics/65165\r\n\r\ntry this:\r\nhttps://stackoverflow.com/questions/43424994/install-redmine-plug-in-using-docker-container\r\n\r\n\r\nsee "starter":https://github.com/bitnami/bitnami-docker-redmine/issues/115\r\n\r\nsee "detail":https://stackoverflow.com/questions/43424994/install-redmine-plug-in-using-docker-container\r\n\r\nUse Top to monitor progress\r\n<pre>\r\n#cleanup\r\ndocker system prune \r\nsource ./scripts/initialize.sh\r\n\r\n# basic build\r\ndocker-compose build\r\ndocker-compose up\r\n# works?\r\n{CTRL-C}\r\n\r\n#upgrade to new app with plugin libraries (but no plugins)\r\n#edit docker-compose to use new redmine build (option 2, comment out 1)\r\ndocker-compose build\r\ndocker-compose up\r\n# works?\r\n\r\n# import prod data\r\ndocker cp hub/data/redmine.sql brs_postgresql_1:/tmp\r\ndocker exec -it brs_postgresql_1 /bin/bash\r\npg_restore --clean --if-exists --no-acl --no-owner --verbose -d bitnami_redmine -U postgres /tmp/redmine.sql\r\npsql -U postgres -c 'ALTER USER bn_redmine WITH SUPERUSER;'\r\nexit\r\n\r\n# import prod data - migrate\r\ndocker exec -it brs_redmine_1 /bin/bash\r\ncd /opt/bitnami/redmine\r\nbundle exec rake db:migrate RAILS_ENV=production\r\ntouch tmp/restart.txt\r\n# works?\r\nexit\r\n\r\n# add new plugs libraries\r\ndocker cp hub/redmine_agile brs_redmine_1:/bitnami/redmine/plugins\r\ndocker cp hub/redmine_checklists brs_redmine_1:/bitnami/redmine/plugins\r\ndocker cp hub/redmineup_tags brs_redmine_1:/bitnami/redmine/plugins\r\n\r\n# add new plugs libraries - activate\r\n\r\ndocker exec -it brs_redmine_1 /bin/bash\r\ncd /opt/bitnami/redmine\r\nbundle exec rake redmine:plugins NAME=redmine_agile RAILS_ENV=production\r\nbundle exec rake redmine:plugins NAME=redmine_checklists RAILS_ENV=production\r\nbundle exec rake redmine:plugins NAME=redmineup_tags RAILS_ENV=production\r\ntouch ./tmp/restart.txt\r\n# works?\r\n\r\n#load wiki...\r\n\r\n# increase upload file size\r\n# https://www.cyberciti.biz/faq/linux-unix-bsd-nginx-413-request-entity-too-large/\r\n\r\ndocker run --rm -it -v=brs_nginx_data:/tmp/myvolume busybox\r\ncd /tmp/myvolume/conf.d\r\nvi custom_proxy_settings.conf\r\n# client_max_body_size 16m;\r\nexit\r\n\r\n#add logo\r\n#add users\r\n\r\n#needed?\r\ndocker cp wiki/ClipUpload brs_mediawiki_1:/extensions/ClipUpload\r\n\r\nimport pages\r\nimport images\r\nedit LocalSetting:  set logo, add custome\r\n\r\nsetup notebooks\r\n\r\n</pre>\r\n\r\n\r\n!clipboard-202006152221-duu2r.png!\r\n
